import React from 'react';
import MediaCard from './MediaCard';
import logo from './logo.svg';

const imgURL = 'https://avatars.githubusercontent.com/u/73801003?s=460&u=1e221d0595b5b6de862687a1fcfdf3e2a8c814ba&v=4';
const imgURL2 = 'https://scontent-mad1-1.xx.fbcdn.net/v/t1.0-9/1507790_10152710038822565_775677650_n.jpg?_nc_cat=106&ccb=3&_nc_sid=19026a&_nc_ohc=5ZmsmkG9qdgAX9R1EC-&_nc_ht=scontent-mad1-1.xx&oh=5aabd42e30ad3cad8241a2d5db1a56b2&oe=605832E2';


class MediaList extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (<section>
            <h2></h2>
            <ul>
                <MediaCard img= {imgURL} />
                <MediaCard img= {logo}/>
                <MediaCard img= {imgURL}/>
            </ul>
        </section>);

    }

}

export default MediaList;
